INSERT INTO `wp_posts` VALUES("1392", "1", "2017-03-03 14:06:46", "2017-03-03 14:06:46", "Phileas Fogg, as self-composed as if the judgment did not in the least concern him, did not even lift his eyebrows while it was being pronounced.  Just as the clerk was calling the next case, he rose, and said, \"I offer bail.\" Fix saw them leave the carriage and push off in a boat for the steamer, and stamped his feet with disappointment. Eleven o\'clock was striking; Mr. Fogg was an hour in advance of time.\r\n\r\n\"I will pay it at once,\" said Mr. Fogg, taking a roll of bank-bills from the carpet-bag, which Passepartout had by him, and placing them on the clerk\'s desk. \"This sum will be restored to you upon your release from prison,\" said the judge.  \"<strong>Meanwhile, you are liberated on bail</strong>.\" \"Come!\" said Phileas Fogg to his servant. \"But let them at least give me <a href=\"#\">back my shoes!</a>\" cried Passepartout angrily. \"Ah, these are pretty dear shoes!\" he muttered, as they were handed to him.  \"More than a thousand pounds apiece; besides, they pinch my feet.\"\r\n\r\nFix still nourished hopes that the robber would not, after all, leave the two thousand pounds behind him, but would decide to serve out his week in jail, and issued forth on Mr. Fogg\'s traces. That gentleman took a carriage, and the party were soon landed on one of the quays. The Rangoon was moored half a mile off in the harbour, its signal of departure hoisted at the mast-head.\r\n\r\nThe rascal is off, after all!\" he exclaimed.  \"Two thousand pounds sacrificed!  He\'s as prodigal as a thief!  I\'ll follow him to the end of the world if necessary; but, at the rate he is going on, the stolen money will soon be exhausted. The detective was not far wrong in making this conjecture.  Since leaving London, what with travelling expenses, bribes, the purchase of the elephant, bails, and fines, Mr. Fogg had already spent more than five thousand pounds on the way.Phileas Fogg, as sel